import React from "react";
import { Switch, Route, Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";

class App extends React.Component {
  render(){
    return(
      <div class="container-flex">
        <div class="card bg">
          <img src="./bcg1.jpg"  class="card-img" alt="bckground img"/>
        <div class="card-img-overlay">
          <img src="./logo.png" alt="Logo" width="180" height="120" class="d-aline-block align-text-inline"/>
        <div class="final">
        <nav className="navbar justify-content-center navbar-transparent bg-transparent">
          <p class="nav-link" aria-current="page" href="#">Home</p>
          <p class="nav-link" href="#">Summer 2022</p>
          <p class="nav-link" href="#">Weekends</p>
        </nav>
        </div>
        </div>
        </div>
    </div>

    )
  }
}

export default App;
